css:
@-moz-document domain("funda.nl") {
html {
  filter: invert(1);
}

header.app-header {
  filter: invert(1) brightness(1.8);
  z-index: 999;
}

.object-header__map,
.accordion__item-header-category, .location-detail__header-category,
.search-result__header-labels,
.object-save-share__button-save svg.fd-color-red-1,
.object-header__labels .badges-container,
.media-viewer-map-canvas div[style^="z-index: 1; position: absolute; left: 50%; top: 50%; width: 100%; transform: translate"] > div:not([style*="z-index: 0"]) {
  filter: invert(1) brightness(1.4);
}

.map__canvas div[style="position: absolute; left: 0px; top: 0px; z-index: 100; width: 100%;"],
.map__canvas .personal-place-marker {
  filter: invert(1) brightness(2) contrast(2);
}

.map__canvas, .object-map-canvas, .media-viewer-map-canvas {
  opacity: 75%;
}

img,
.app-header__submenu {
  filter: invert(1);
}
}
